import React from 'react'

export default function Navbar() {
  return (
    <div className="bg-secondary">
        <div className="text-white max-w-screen-xl mx-auto p-2">
            <img src="./logo.png" alt="" className='h-10' />
            <ul>
                <li>Login</li>
            </ul>
        </div>
    </div>
  );
}
